import React from "react";
import { HelmetProvider } from "react-helmet-async";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Navbar from "./components/Navbar";
import Footer from "./components/Footer";

import HomePage from "./pages/HomePage";
import Enquiry from "./pages/Enquiry";
import Contact from "./pages/Contact";
import About from "./pages/About";
import CakesAndClasses from './pages/CakesAndClasses';

import Health from "./pages/Cakes and Class/Health";
import Life from "./pages/Cakes and Class/Life";
import Vehicle from "./pages/Cakes and Class/Vehicle";

function App() {
  return (
    <HelmetProvider>
      <Router>
        <div className="flex flex-col min-h-screen bg-white text-black">
          {/* Navbar */}
          <Navbar />

          {/* Main Content */}
          <main className="flex-grow max-w-6xl mx-auto p-6">
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/enquiry" element={<Enquiry />} />
              <Route path="/contact" element={<Contact />} />
              <Route path="/about" element={<About />} />
              <Route path="/Cakes and Classes/health" element={<Health />} />
              <Route path="/Cakes and Classes/life" element={<Life />} />
              <Route path="/Cakes and Classes/vehicle" element={<Vehicle />} />
              <Route path="/CakesandClasses" element={<CakesandClasses />} />
            </Routes>
          </main>

          {/* Footer */}
          <Footer />
        </div>
      </Router>
    </HelmetProvider>
  );
}

export default App;
